$(function() {

    // Meet Graham
    var graham = 'data:image/png;base64,';

    console.log('init');
    $('img').each(function() {
        // Graham is very tall, so we only really need the height, but we need to set the dimensions on the wrapper.
        var imgHeight = $(this).height();
        var imgWidth = $(this).width();

        // How tall is Graham today? This will stop poor Graham stretching in his box.
        var grahamHeight = 609;
        if(imgHeight < grahamHeight) {
            grahamHeight = imgHeight;
        }

        // Let's not show Graham if the image is small, that will just look silly.
        if(imgHeight > 20) {
            $(this).wrap('<div class="graham-wrapper" style="position: relative; width: ' + imgWidth + 'px; height: ' + imgHeight + 'px;">');
            $(this).closest('.graham-wrapper').append('<img class="graham" src="' + graham + '">');
            $(this).closest('.graham-wrapper').find('.graham').css({
                'height': grahamHeight,
                'width': 'auto',
                'maxWidth': 'auto',
                'position': 'absolute',
                'right': 0,
                'bottom': 0
            });
        }
    });

});
